import { __decorate } from "tslib";
import { Component } from '@angular/core';
let ForminfoComponent = class ForminfoComponent {
    constructor(id, name, date, selectedPermitType, isWorkAtHeight, selectedLocationOfWork, startDate, endDate, signalrhubservice) {
        this.signalrhubservice = signalrhubservice;
        this.id = id;
        this.name = name;
        this.date = date;
        this.selectedPermitType = selectedPermitType;
        this.isWorkAtHeight = isWorkAtHeight;
        this.selectedLocationOfWork = selectedLocationOfWork;
        this.startDate = startDate;
        this.endDate = endDate;
    }
    async receiveDataFromServer(id) {
        await this.signalrhubservice.hubConnection.invoke("sendDataFrmServer", id).finally(() => {
            console.log("Received Succesfully");
        })
            .catch((err) => console.error(err));
    }
    getFormInfo(id) {
        let formValue;
        return formValue;
    }
    setFormInfo(input) {
        let formValue;
        return formValue = input;
    }
    ngOnInit() {
    }
};
ForminfoComponent = __decorate([
    Component({
        selector: 'app-forminfo',
        templateUrl: './forminfo.component.html',
        styleUrls: ['./forminfo.component.scss']
    })
], ForminfoComponent);
export { ForminfoComponent };
